import styled from '@emotion/styled';

const ButtonStyle = styled.button`
display = ${(props) => (props.isVisible ? '' : 'none')};

`;

const MoreButton = (isVisible, setOffset) => {
  return (
    <ButtonStyle data-testid="more-button" onClick={(props) => props.setOffset((prev) => prev + 1)}>
      테스트
    </ButtonStyle>
  );
};

export default MoreButton;
